import React from 'react';
import './App.css';
import Card from './components_example/Card.js';
import Clock from './state_and_life_cycle/Clock';
import Timer from './state_and_life_cycle/Timer';
import ClickCounter from './events/ClickCounter';
import AddEvent from './events/AddEvent';
import List from './lists_and_keys/List';

// functional component
function FuncGreeting(props) {
  return <p>Hello {props.name} </p>
}

// class component
class Goodbye extends React.Component {

  render() {
    return <p>Goodbye {this.props.name}</p>
  }
}

function App() {
  return (
    <div className="container">
      <FuncGreeting name="Jonathan" />
      <FuncGreeting name="Joseph"/>
      <FuncGreeting name="Jotatro" />
      <Goodbye name="Jojo" />
      <Card 
        url="https://i.ytimg.com/vi/4Zev7cJkuJc/maxresdefault.jpg"
        imgAlt="Dio"
        name="Dio Brando"
        series="Jojo"
      />
      <Card 
        url="https://i.ytimg.com/vi/4Zev7cJkuJc/maxresdefault.jpg"
        imgAlt="Dio"
        name="Dio Brando"
        series="Jojo"
        details="Copyright"
      />
      <Clock/>
      <Timer increment={1} />
      <Timer increment={4} />
      <ClickCounter/>
      <hr/>
      <AddEvent textColor='red' />
      <List title='Colors' items={ ['red', 'blue', 'green'] }/>
      <List title='Food' items={ ['pizza', 'tacos', 'fried anything', 'ice cream'] } />
    </div>
  );
}

export default App;
